css:
atom-text-editor,
:host {
  background-color: #fafafa;
  color: #615f51;
}
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background-color: rgba(56, 75, 112, 0.07);
}
atom-text-editor .invisible,
:host .invisible {
  color: #615f51;
}
atom-text-editor .cursor,
:host .cursor {
  border-left: 2px solid #3474f4;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #e5e5e6;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border-bottom: 1px solid #3474f4;
  box-sizing: border-box;
  background-color: #eaeaeb;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(97, 95, 81, 0.4);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(97, 95, 81, 0.4);
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(97, 95, 81, 0.4);
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  color: #9d9e9f;
  -webkit-font-smoothing: antialiased;
}
atom-text-editor .gutter .line-number.git-line-removed:before,
:host .gutter .line-number.git-line-removed:before {
  bottom: -3px;
}
atom-text-editor .gutter .line-number.git-line-removed:after,
:host .gutter .line-number.git-line-removed:after {
  content: "";
  position: absolute;
  left: 0px;
  bottom: 0px;
  width: 25px;
  border-bottom: 1px dotted rgba(255, 20, 20, 0.5);
  pointer-events: none;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  color: #676a6f;
  background-color: #eff0f0;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  background-color: transparent;
}
atom-text-editor .gutter .line-number .icon-right,
:host .gutter .line-number .icon-right {
  color: #615f51;
}
atom-text-editor .gutter .line-number .icon-right,
:host .gutter .line-number .icon-right {
  color: #615f51;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #676a6f;
}
.comment {
  color: #908b6f;
  font-style: italic;
}
.entity.name.type {
  color: #a18912;
}
.entity.other.inherited-class {
  color: #4b862c;
}
.keyword {
  color: #a431c4;
}
.keyword.control {
  color: #a431c4;
}
.keyword.operator {
  color: #615f51;
}
.keyword.other.special-method {
  color: #3b62d9;
}
.keyword.other.unit {
  color: #87400d;
}
.storage {
  color: #a431c4;
}
.constant {
  color: #87400d;
}
.constant.character.escape {
  color: #178262;
}
.constant.numeric {
  color: #87400d;
}
.constant.other.color {
  color: #178262;
}
.constant.other.symbol {
  color: #178262;
}
.variable {
  color: #b72424;
}
.variable.interpolation {
  color: #b0263f;
}
.variable.parameter.function {
  color: #615f51;
}
.invalid.illegal {
  background-color: #b72424;
  color: #fafafa;
}
.string {
  color: #4b862c;
}
.string.regexp {
  color: #178262;
}
.string.other.link {
  color: #b72424;
}
.punctuation.definition.comment {
  color: #908b6f;
}
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #615f51;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #3b62d9;
}
.punctuation.definition.bold {
  color: #a18912;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #a431c4;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #b0263f;
}
.support.class {
  color: #a18912;
}
.support.function {
  color: #178262;
}
.support.function.any-method {
  color: #3b62d9;
}
.entity.name.function {
  color: #3b62d9;
}
.entity.name.class,
.entity.name.type.class {
  color: #a18912;
}
.entity.name.section {
  color: #3b62d9;
}
.entity.name.tag {
  color: #b72424;
}
.entity.other.attribute-name {
  color: #87400d;
}
.entity.other.attribute-name.id {
  color: #3b62d9;
}
.meta.class {
  color: #a18912;
}
.meta.link {
  color: #87400d;
}
.meta.require {
  color: #3b62d9;
}
.meta.selector {
  color: #a431c4;
}
.meta.separator {
  background-color: #373b41;
  color: #615f51;
}
.meta.tag {
  color: #615f51;
}
.none {
  color: #615f51;
}
.markup.bold {
  color: #87400d;
  font-weight: bold;
}
.markup.changed {
  color: #a431c4;
}
.markup.deleted {
  color: #b72424;
}
.markup.italic {
  color: #a431c4;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #3b62d9;
}
.markup.inserted {
  color: #4b862c;
}
.markup.list {
  color: #b72424;
}
.markup.quote {
  color: #87400d;
}
.markup.raw.inline {
  color: #4b862c;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b72424;
}
.source.gfm .markup.link {
  color: #3b62d9;
}
.source.gfm .link .entity {
  color: #178262;
}
.ruby.symbol > .punctuation {
  color: inherit;
}
